package com.rongke.service.impl;import com.baomidou.mybatisplus.service.impl.ServiceImpl;import com.rongke.mapper.FeedbackMapper;import com.rongke.model.Feedback;import com.rongke.service.FeedbackService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;/** * @FeedbackServiceImpl * @ServiceImpl * @version : Ver 1.0 */@Servicepublic class FeedbackServiceImpl extends ServiceImpl<FeedbackMapper, Feedback> implements FeedbackService {    @Autowired    private FeedbackMapper feedbackMapper;    /**     * @根据条件查找     * @param feedback     * @return     */    @Override    public List<Feedback> selectByCondition(Feedback feedback) {        return feedbackMapper.selectByCondition(feedback);    }}